import React, {Component} from 'react'
import {Link, BrowserRouter as Route} from 'react-router-dom'
import RegisterForm from '../forms/Register'

class Navbar extends Component{
    state = {
        isLoggedIn: false,
    }
    onActive = () => {
        console.log(this.state.currentPath)
        return this.props.setActivePath("http://localhost:3000/register", this.props.currentPath);
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login 
                            <Route path="/register" render={() => <RegisterForm/>}>
                                <Link style={this.onActive()} onClick={this.props.handleClick}  name="register" className="registerLink" to="/register">
                                 Register
                                </Link>
                            </Route>
                        </h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}

export default Navbar;
